import React from 'react'

interface MemberBoxProps {
  clickedAccountList: Array<string>
  account_id: string
  birth_date: string
  gender: string
  name: string
  phone_number: string
}

export const MemberBox = (props: MemberBoxProps) => {
  const {
    clickedAccountList,
    account_id,
    birth_date,
    gender,
    name,
    phone_number,
  } = props

  return (
    <>
      <div>
        {account_id}, {birth_date}, {gender}, {name}, {phone_number}
      </div>
    </>
  )
}
